import React from "react";
import {BrowserRouter, Route, Switch, Link} from "react-router-dom";

import { MdApps, MdHome, MdPeople, MdNotifications, MdAccountCircle, MdSettings, MdPowerSettingsNew } from "react-icons/md";

import './Sidenav.css'


export default function Sidenav(){
    return (
        <div className="sidenav--wrapper my-primary-color">
            <ul className="sidenav--header">
                <li className="sidenav-nav-link active"><Link to="/root"><MdHome/></Link></li>
                <li className="sidenav-nav-link"><Link to="/stations"><MdApps/></Link></li>
                <li className="sidenav-nav-link"><Link to="/customers"><MdPeople/></Link></li>
                <li className="sidenav-nav-link"><Link to="/notifications"><MdNotifications/></Link></li>
            </ul>
            <BrowserRouter>
                <ul className="sidenav--footer">
                    <li className="sidenav-nav-link"><Link to="/profile"><MdAccountCircle/></Link></li>
                    <li className="sidenav-nav-link"><Link to="/setting"><MdSettings/></Link></li>
                    <li className="sidenav-nav-link"><Link to="/logout"><MdPowerSettingsNew/></Link></li>
                </ul>
            </BrowserRouter>
        </div>
    )
}
